import React from "react";
import logo from "./asset/TestLogo.svg"


function Nav() {
  return (
    <div className="w-[1564px] h-[72px] m-[18px] rounded-[70px] bg-[#ffffff]">
      <div>
        <img className="my-[30px] mx-[50px] h-[48px] w-" src={logo}></img>
      </div>
      <div></div>
      <div></div>
    </div>
  );
}

export default Nav;
